import React, { Component } from 'react';
import ReactDom from 'react-dom';

class PortalsDemo extends Component {
    render(){
        return ReactDom.createPortal(
            <h1>Hello Portal</h1>,
            document.getElementById('Portal-root')
        )
    }
}

export default PortalsDemo;
